import React from 'react';
import MainLogo from '../assets/main-logo.svg'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function About() {
  return (
    <div className="About">
      <Link to="/"><img className="logo"  src={MainLogo} alt='MainLogo' /></Link>

    </div>
  );
}

export default About;
